{'pk': 18156555628004132, 'user_id': 4083812226, 'text': 'Nuestra colecci√≥n Estudios de Moda busca llenar la ausencia de textos en espa√±ol en el campo de los fashion studies. Ya tenemos tres t√≠tulos para entretenernos, y pronto vendr√°n m√°s (pero de eso les contamos m√°s adelante) ‚ù§Ô∏è. Los consiguen en la @feriadeeditores este fin de semana. Nos acompa√±a @libreria.norte

