{'pk': 17860345547039149, 'user_id': 4083812226, 'text': '‚ÄúLa ubicuidad del libro como objeto de arte comercializable llev√≥ al escritor y artista mexicano Ulises Carri√≥n (1941-1989) a escribir en 1975: ‚ÄòUn libro puede ser el recipiente accidental de un texto cuya estructura es irrelevante al libro: son los libros de las librer√≠as y las bibliotecas‚Äô. [‚Ä¶] El an√°lisis ir√≥nico del libro como objeto comercial por parte de Carri√≥n refleja la separaci√≥n de la forma y el contenido que percib√≠a en la escritura y la publicaci√≥n de la √©poca. [‚Ä¶] En parte, lo de Carri√≥n era un llamamiento a que los autores estuvieran m√°s atentos a la materialidad del libro y al impacto sobre el sentido, pero tambi√©n era un pedido para romper con un sistema que privilegiaba la escritura como labor intelectual y denigraba el aspecto f√≠sico de la producci√≥n del libro‚Äù.

Fragmento de El libro expandido, de Amaranth Borsuk. El libro de artista y su manera de cuestionar el contenido a trav√©s de la forma es un elemento fundamental en el an√°lisis que hace la autora para trazar la historia del libro y la experimentaci√≥n con sus suportes. Aqu√≠, el ejemplo de Ulises Carri√≥n, precursor latinoamericano en ese √°mbito.

